                <img className="nav-logo" src={logo} alt="logo"></img>
                <h5 id='player-turn'>Roll Dice</h5>
            </div>
            <div className="logo-container">
                <h6>Dice    :</h6>
                <h6 id="dice-counter">0</h6>
            </div>
        </nav>
    )
}
